import './App.css';

function App() {
  const [cart, setCart] = useState([]);
  return (
    <div className="App">
        <h1>Shopee Cart</h1>
        <div className="items">
          <div className="item">
            <h2>Item 1</h2>
            <p>Price: R$10.00</p>
            <p>Quantity: 1</p>
            <button>Add to Cart</button>
          </div>
        </div>
    </div>
  );
}

export default App;
